import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material';

function Navbar() {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6">
          Moje React App
        </Typography>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
